import { useState, useEffect } from "react";
import axios from "axios";

function Pacients() {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    axios.get("http://localhost:5000/api/users").then((response) => {
      setUsers(response.data);
    });
  }, []);
  
  function deleteUser(emailAddress){
    
    axios.delete("http://localhost:5000/api/users",{data:{Email:emailAddress}}).then((response) => {
      console.log(response.data);
    });
  }
  return (
    <div>
      <div>
        <input type="text" id="pacientSearch" placeholder="Search pacient " />
        <button type="button" class="btn btn-success">
          Search
        </button>
      </div>
      <div class="table-responsive">
        <table class="table">
          <thead>
            <tr>
              <th>Last Name</th>
              <th>First Name</th>
              <th>Email</th>
              <th>CNP</th>
              <th></th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            {users.map((user) => {
              console.log(user);
              return (
                <tr>
                  <td>{user.Nume}</td>
                  <td>{user.Prenume}</td>
                  <td>{user.CNP}</td>
                  <td>{user.Email}</td>
                  <td>
                    <button type="button" class="btn" onClick={()=>deleteUser(user.Email)}>
                    <i class="fa fa-trash"></i>
                    </button>
                  </td>
                  <td>
                    <button type="button" class="btn">
                    <i class="fa fa-edit"></i>
                    </button>
                  </td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Pacients;
